webpackJsonp([0x7450475e22ab3800],{"./node_modules/json-loader/index.js!./.cache/json/javascript-truthy-values.json":function(e,n){e.exports={data:{markdownRemark:{html:"<p>A <strong>truthy</strong> value is a value that translates to <strong>true</strong> when evaluated in a <em>Boolean</em> context.</p>\n<p>All values are <strong>truthy</strong> unless they are defined as <strong>falsy</strong> (i.e. except for <code>false</code>, <code>0</code>, <code>\"\"</code>, <code>null</code>, <code>undefined</code> and <code>NaN</code>).</p>\n<p>Some interesting <strong>truthy</strong> values are:</p>\n<p>‘0’ (a string containing a single zero)\n‘false’ (a string containing the text “false”)\n[] (an empty array)\n{} (an empty object)\nfunction(){} (an “empty” function)</p>\n<p>A single value can therefore be used within conditions, e.g.</p>\n<p>if (value) {\n// value is truthy\n}\nelse {\n// value is falsy\n// it could be false, 0, ”, null, undefined or NaN\n}</p>\n<p>See also: <a>falsy</a> | <a href='https://developer.mozilla.org/en-US/docs/Glossary/Truthy' target='_blank' rel='nofollow'>MDN</a></p>",fields:{slug:"/javascript/truthy-values/"},frontmatter:{title:"Truthy Value"}}},pathContext:{slug:"/javascript/truthy-values/"}}}});
